import './App.css';
import Home from './components/Home';
import Landing from './components/Landing';

function App() {
  return (
    <div className="App" >
    <Route path="/" exact component={Landing}/>
    <Route path="/home" component={Home}/>

    </div>
  );
}

export default App;
